description:
Янги дизайн, қўшимча қулайликлар ва янги электрон хизматлар қўшилди:
- Харид чекларидан 1% кэшбек олиш;
- Солиқ хамкор тизими орқали юборилган мурожаат учун 20% мукофот пули олиш;
- Талабалар учун ижара шартномаларини расмийлаштириш;
- Маркировкаланган маҳсулотларни қалбакиликка текшириш;
- Солиқ текшириш буйруқларини хақиқийлигини текшириш
